pub enum Compound<'a, W: 'a, F: 'a> {
    Map {
            ser: &'a mut Serializer<W, F>,
            state: State,
        },
}

pub enum SerializeMap {
    Map {
            map: Map<String, Value>,
            next_key: Option<String>,
        },
}

pub enum Reference<'b, 'c, T> where T: ?Sized + 'static {
    Borrowed(&'b T),
    Copied(&'c T),
}
